function NaverLogin() {
    const NAVER_CLIENT_ID = `RW8Pxm3r0bLsV0ZUHq79`;
    const NAVER_REDIRECT_URI = `http://localhost:3000/oauth/callback/naver`;
    const NAVER_STATE = "flase";
    const NAVER_URI = `http://nid.naver.com/oauth2.0/authorize?response_type=code&client_id=${NAVER_CLIENT_ID}&state=${NAVER_STATE}&redirect_uri=${NAVER_REDIRECT_URI}`

    return (
        <a href={NAVER_URI}>
            <button>네이버로그인버튼</button>
        </a>
    );
}

export default NaverLogin;
